class Solution {
    public int reverseDigits(int n) {
        // Handle negative numbers separately
        boolean negative = n < 0;
        n = Math.abs(n); // make n positive for processing

        int reversed = 0;
        while (n > 0) {
            int digit = n % 10;
            reversed = reversed * 10 + digit;
            n /= 10;
        }
        
        return negative ? -reversed : reversed;
    }
}

